def sum_c(c,n):
	sum=0
	for i in range(n):
		sum+=c[i]
	return sum

def solve(n,k,c):
	ans=0
	for i in range(n):
		for j in range(i+1,n):
			if c[i]>c[j]:
				c[i],c[j]=c[j],c[i]
				ans+=sum_c(c,j-i+1)
	return ans


n,k=list(map(int,input().split()))
c=list(map(int,input().split()))
print(solve(n,k,c))
